I just checked the source of the endless recursion and tracked it down to the bubble events added by the marshaler. If you have a loop in your relations in the model, you get an endless loop because when adding the child, it fires an event which will be taken by the parent and fired again... that back and forth. But as already said, thats the way it was since the beginning so no regression. 

Here is the code to reproduce:

var createRandomData = function(parent) {
  var node = {
    parent: parent
  };
  var model = qx.data.marshal.Json.createModel(node, true);
  parent.getChildren().push(model);
};

var root = {children: []};
root = qx.data.marshal.Json.createModel(root, true);
createRandomData(root);
